INSERT INTO `modul` (`id`, `judul`, `isi`, `gambar`, `created_at`, `updated_at`, `count`, `status`, `kategori_modul`, `jenis_id`, `jenjang_id`, `kelas_id`, `mapel_id`, `harga_lama`, `harga`, `sertifikat`, `trainer_id`) VALUES
(2, 'Teaching Mastery Framework', '<p>Teaching Mastery Framework adalah kumpulan kompetensi.yang harus dimiliki seorang guru untuk bisa mengajar secara efektif. Efektifitas pengajaran di ukur sistem response siswa selama proses pengajaran berlangsung yang bisa dikelompokkan pada 4 aspek; yaitu, Afeksi, Behavior, Engagement dan Cognition. Ke-4 aspek ini harus bisa terukur secara objective, artinya, guru harus mampu menunjukkan bukti bahwa siswa berhasil memperlihatkan kemajuan pada ke - 4 aspek tersebut.</p>\r\n\r\n<p>TMF dirancang secara bertahap oleh Zulfikar Alimuddin, dan kemudian dikembangkan berdasarkan proses implementasi, review dan evaluasi secara berkelanjutan selama hampir 4 tahun di Global Islamic Boarding School, sebuah sekolah berasrama bagi siswa SMP dan SMA.</p>', 'uploads/modul/29538.jpg', '2020-02-18 18:27:44', '2020-04-23 04:19:30', 173, 'Y', 2, 3, 2, 8, 1, 1000000, 150000, 1, 1),
(3, 'Mengupas PCK Teori Geometri Matematika', '<p>Teori Geometri</p>', 'uploads/modul/43190.jpg', '2020-02-18 18:34:51', '2020-04-24 08:09:29', 8, 'Y', 2, 1, 2, 8, 1, 1200000, 120000, 1, 1),
(4, '9 Langkah Kecil oleh Zulfikar Alimuddin', '<p>Beberapa langkah-langkah kecil yang dapat Anda lakukan di kelas untuk membuat siswa Anda merasa nyaman</p>', 'uploads/modul/71783.jpg', '2020-02-18 19:22:50', '2020-04-14 03:14:42', 54, 'Y', 2, NULL, NULL, NULL, NULL, 900000, 99000, 1, 1),
(5, 'Pedagogical Content Knowledge', '<p>Pedagogical Content Knowledge (PCK) adalah sebuah temuan akademis yang sangat menarik. Temuan ini merupakan sebuah ide yang berlandaskan pada keyakinan bahwa mengajar bukan hanya sekedar menyampaikan ilmu pengetahuan kepada siswa untuk mereka menghapalnya, tetapi (lebih dari itu) merupakan proses untuk membuat siswa mampu memahami dan menggunakan pemahamannya guna memecahkan masalah-masalah dalam pembelajaran, bahkan membuat mereka mampu melahirkan ide-ide atau menciptakan gagasan-gagasan termasuk temuan-temuan.</p>', 'uploads/modul/82186.jpg', '2020-02-19 00:36:13', '2020-03-05 03:32:09', 87, 'Y', 2, 1, NULL, NULL, NULL, 2500000, 250000, 1, 1),
(6, '35 Langkah Kecil oleh M. T. Hidayat', '<p>38 Langkah Kecil oleh M. T. Hidayat</p>', 'uploads/modul/99342.jpg', '2020-02-19 00:37:23', '2020-06-17 16:57:34', 196, 'Y', 9, NULL, NULL, NULL, NULL, NULL, 0, 0, 8),
(7, '8 Langkah Kecil oleh Yudhistira Abdi Atmanegara', '<p>8 Langkah Kecil oleh Yudhistira Abdi Atmanegara</p>', 'uploads/modul/46221.jpg', '2020-02-19 00:37:56', '2020-03-05 03:28:10', 100, 'Y', 2, 1, NULL, NULL, NULL, 400000, 240000, 1, 3);
