INSERT INTO `webinar` (`id`, `judul`, `isi`, `tanggal`, `jam`, `link`, `stat`, `created_at`, `updated_at`) VALUES
(1, 'Pedagogical Content Knowledge', '<p>Pedagogical Content Knowledge yaitu kombinasi khusus antara konten dan pedagogi yang dibangun secara unik oleh para guru dan dengan demikian merupakan bentuk khas dari pengetahuan dan pemahaman profesional seorang pendidik atas materi ajarnya yang dibawakan secara eksklusif di dalam kelas. PCK juga dikenal sebagai pengetahuan racikan seorang guru. Ia terdiri dari pengetahuan terpadu yang mewakili akumulasi kebijaksanaan guru sehubungan dengan cara pengajaran yang ia gunakan meliputi: pengetahuan pedagogi, pengetahuan akan pemahaman siswa, pengetahuan akan materi pelajaran, dan pengetahuan guru atas kurikulum. Pengetahuan konten pedagogis harus ditangani dalam konteks pedagogi yang beragam. PCK mengetahui apa, kapan, mengapa, dan bagaimana mengajar menggunakan reservoir pengetahuan tentang praktik dan pengalaman mengajar yang baik oleh seorang guru.</p>', '2019-08-07', '20:00:00', 'https://zoom.us/j/3313743584', 'Free', '2019-07-19 01:06:49', '2019-08-05 19:24:50'),
(2, 'Higher Order Thinking Skills', '<p>Higher Order Thinking Skill yaitu konsep reformasi pendidikan yang didasarkan pada taksonomi pembelajaran (seperti Revisi Taksonomi Bloom). Ide dasarnya adalah bahwa beberapa jenis pembelajaran membutuhkan lebih banyak proses kognitif daripada yang lain, tetapi juga memiliki manfaat yang lebih besar. Dalam taksonomi Bloom, misalnya, keterampilan yang melibatkan analisis, evaluasi, dan kreasi pengetahuan baru dianggap memiliki level yang lebih tinggi daripada pembelajaran atas fakta dan konsep yang memerlukan metode pembelajaran dan pengajaran yang berbeda. HOTS meliputi kemampuan berpikir kritis, logis, reflektif, metakognitif, dan kreatif. Kemampuan ini dapat diaktifkan ketika individu menghadapi masalah, ketidakpastian, pertanyaan, atau dilema yang tidak dikenal. Keberhasilan pengajaran HOTS akan menghasilkan siswa yang memiliki kemampuan untuk membuat penjelasan, keputusan, kinerja, dan gagasan atau produk yang orisinil.</p>', '2019-08-21', '20:00:00', 'https://www.eztalks.com/r/961941354', 'Premium', '2019-06-24 06:30:15', '2019-08-21 04:21:55'),
(3, 'Lesson Plan', '<p>Lesson Plan yaitu deskripsi terperinci guru tentang perencanaan sesi pengajaran atau skenario belajar siswa di kelas. Lesson plan dibuat harian dan dikembangkan oleh seorang guru untuk membimbing pembelajaran kelas.</p>', '2019-08-28', '20:00:00', 'http://hafecs.id', 'Free', '2019-07-29 01:37:09', '2019-08-21 18:55:53'),
(4, 'Teaching Tactic', '<p>Teaching Tactics yaitu sekumpulan strategi tindakan guru untuk mengarahkan suasana belajar di kelas terkait dengan pencapaian tujuan pembelajaran seperti memberikan instruksi-instruksi khusus atau startegi belajar tertentu untuk menghadapi suasana kelas yang dinamis.</p>', '2019-09-04', '20:00:00', 'http://hafecs.id', 'Free', '2019-07-29 01:37:09', '2019-08-21 18:56:38'),
(5, 'Classroom Management', '<p>Classroom Management mengacu pada beragam keterampilan dan teknik yang digunakan guru untuk menjaga siswa tetap mengikuti pembelajaran, fokus, penuh perhatian, mengerjakan tugas, dan produktif secara akademis selama di kelas. Ketika class management dijalankan secara efektif, guru meminimalkan perilaku yang menghambat pembelajaran bagi siswa secara individu maupun kelompok, sementara memaksimalkan perilaku yang memfasilitasi atau meningkatkan pembelajaran. Secara umum, guru yang efektif cenderung menunjukkan keterampilan manajemen kelas yang kuat, sedangkan ciri dari guru yang kurang berpengalaman atau kurang efektif adalah kelas yang tidak teratur yang dipenuhi dengan siswa yang tidak bekerja atau tidak memperhatikan.</p>', '2019-09-11', '20:00:00', 'http://hafecs.id', 'Premium', '2019-07-29 01:37:09', '2019-08-21 18:57:26'),
(6, 'Softskill', '<p>Soft Skill yaitu entitas kepribadian, atribut personal, serta kemampuan komunikasi yang dibutuhkan seorang guru untuk sukses dalam pengelolaan pembelajaran.</p>', '2019-09-18', '20:00:00', 'http://hafecs.id', 'Free', '2019-07-29 01:37:09', '2019-08-21 18:58:01'),
(7, 'Teaching Scenario', '<p>Teaching Scenario yaitu urutan alur pembelajaran yang djalankan seorang guru dalam pembelajaran di kelas berdasarkan lesson plan yang ia buat. Skenario pengajaran yang disusun dengan baik tidak hanya memungkinkan anak untuk mengeksplorasi topik yang kompleks secara mendalam dan mencapai tujuan pembelajaran, tetapi juga mengembangkan keterampilan mereka dalam pemikiran analitis, kolaborasi, komunikasi, dan membantu mereka mengembangkan kepercayaan terhadap keterampilan tersebut.</p>', '2019-09-25', '20:00:00', 'http://hafecs.id', 'Premium', '2019-07-29 01:37:09', '2019-08-21 18:59:22'),
(8, 'Teaching Grading', '<p>Teaching Grading yaitu proses penilaian kinerja guru untuk tujuan self reflection dengan meninjau ulang kelasnya melalui video dan mendapatkan feedback atas efektivitas pengajarannya di kelas dalam kaitannya dengan pengembangan kompetensi mengajar yang dimiliki guru dan apa yang harus mereka lakukan untuk memperbaikinya.</p>', '2019-10-02', '20:00:00', 'http://hafecs.id', 'Free', '2019-07-29 01:37:09', '2019-08-21 19:00:33');
